import React from 'react';
import { Box, Typography, TextField, Button, Grid, Paper } from '@mui/material';

const featuredBooks = [
  { id: 1, title: 'Sefiller', author: 'Victor Hugo' },
  { id: 2, title: 'Suç ve Ceza', author: 'Fyodor Dostoyevski' },
  { id: 3, title: 'Kürk Mantolu Madonna', author: 'Sabahattin Ali' },
];

const Home = () => (
  <Box sx={{ mt: 4 }}>
    <Typography variant="h3" align="center" gutterBottom>Kütüphaneye Hoşgeldiniz</Typography>
    <Typography variant="h6" align="center" gutterBottom>Binlerce kitap, tek tıkla elinizin altında.</Typography>
    <Box sx={{ display: 'flex', justifyContent: 'center', my: 4 }}>
      <TextField label="Kitap ara..." variant="outlined" sx={{ width: 300, mr: 2 }} />
      <Button variant="contained" color="primary">Ara</Button>
    </Box>
    <Typography variant="h5" gutterBottom>Öne Çıkan Kitaplar</Typography>
    <Grid container spacing={2}>
      {featuredBooks.map(book => (
        <Grid item xs={12} sm={4} key={book.id}>
          <Paper sx={{ p: 2 }}>
            <Typography variant="h6">{book.title}</Typography>
            <Typography variant="body2" color="text.secondary">{book.author}</Typography>
          </Paper>
        </Grid>
      ))}
    </Grid>
  </Box>
);

export default Home;
